import './App.css';
import Header from './MyComponents/Header';
import Home from './MyComponents/Home';
import {BrowserRouter as Router, Routes, Route} from "react-router-dom";

function App() {
  return (
    <Router>
    <div className="app">
      <Routes>
        <Route path="/">
          <Header/>
          <Home/>
        </Route>
        <Route path="/checkout">
          <Header/>
          <p>React Router Demo</p>
        </Route>
      </Routes>
    </div>
    </Router>
  );
}

export default App;
